import React from 'react';
import Header from './components/header.jsx';
import Footer from './components/footer.jsx';


function Home() {
  return (
    <main className="container">
    <br/>
      Home
      <div style="display: grid;">
      <iframe height="250" src="https://www.youtube-nocookie.com/embed/1-iQnh-cH7o" title="YouTube video player" frameBorder="0" allow="accelerometer; autoplay; clipboard-write; encrypted-media; gyroscope; picture-in-picture" allowFullScreen></iframe>

      </div>
    </main>
  );
}

export default Home;
